import React, { useState, useEffect } from 'react';

const AdminPanel = ({ contract, account, onBack }) => {
  const [hospitals, setHospitals] = useState([]);
  const [loading, setLoading] = useState(true);
  const [processing, setProcessing] = useState(null);
  const [isOwner, setIsOwner] = useState(false);

  useEffect(() => {
    checkOwnership();
    loadHospitals();
  }, [contract, account]);

  const checkOwnership = async () => {
    try {
      const owner = await contract.owner();
      const userIsOwner = owner.toLowerCase() === account.toLowerCase();
      setIsOwner(userIsOwner);

      if (!userIsOwner) {
        alert("Access denied: Only contract owner can access this panel.");
        onBack();
      }
    } catch (error) {
      console.error("Ownership check failed:", error);
    }
  };

  const loadHospitals = async () => {
    try {
      setLoading(true);
      const events = await contract.queryFilter(contract.filters.HospitalRegistered(), 0, 'latest');
      const uniqueAddresses = [...new Set(events.map(e => e.args.hospital))];

      const hospitals = await Promise.all(
        uniqueAddresses.map(async (address) => {
          const info = await contract.getHospitalInfo(address);
          const isAuthorized = await contract.authorizedHospitals(address);
          return {
            address,
            name: info[0],
            license: info[1],
            contact: info[2],
            isAuthorized
          };
        })
      );

      setHospitals(hospitals);
    } catch (err) {
      console.error("Failed to load hospitals:", err);
    } finally {
      setLoading(false);
    }
  };

  const toggleAuthorization = async (address, currentStatus) => {
    try {
      setProcessing(address);
      const tx = await contract.setHospitalAuthorization(address, !currentStatus);
      await tx.wait();
      await loadHospitals();
    } catch (error) {
      console.error("Authorization update failed:", error);
      alert("Transaction failed: " + error.message);
    } finally {
      setProcessing(null);
    }
  };

  const HospitalCard = ({ h }) => (
    <div className="hospital-card">
      <h3>üè• {h.name || 'Unnamed Hospital'}</h3>
      <p><strong>License:</strong> {h.license}</p>
      <p><strong>Contact:</strong> {h.contact}</p>
      <p><strong>Wallet:</strong> <code>{h.address}</code></p>
      <p><strong>Status:</strong> {h.isAuthorized ? '‚úÖ Authorized' : '‚è≥ Pending'}</p>
      <button
        onClick={() => toggleAuthorization(h.address, h.isAuthorized)}
        disabled={processing === h.address}
        className={h.isAuthorized ? "btn-revoke" : "btn-authorize"}
      >
        {processing === h.address
          ? (h.isAuthorized ? '‚è≥ Revoking...' : '‚è≥ Authorizing...')
          : (h.isAuthorized ? '‚ùå Revoke Access' : '‚úÖ Authorize')}
      </button>
    </div>
  );

  return (
    <div className="admin-panel">
      <div className="admin-header">
        <h2>üëë Admin Panel</h2>
        <p>Only the contract owner can manage hospital authorizations</p>
        <button onClick={onBack} className="btn-secondary">‚Üê Back</button>
      </div>

      {loading ? (
        <div className="loading-box">
          <p>‚è≥ Loading hospital data...</p>
        </div>
      ) : (
        <div className="hospital-list">
          {hospitals.length === 0 ? (
            <p>No hospitals registered yet.</p>
          ) : (
            hospitals.map((h, i) => <HospitalCard key={i} h={h} />)
          )}
        </div>
      )}
    </div>
  );
};

export default AdminPanel;
